import React from 'react'

 const PdfUploader = ({documents,onselect}) => {
  return (
    <div>
        <h2>Documents</h2>
        <ul>
            {documents.map((doc,ind)=>{
                <li key={ind}>
                    <button onClick={()=>onselect(doc)}>jj</button>
                </li>
            })}
        </ul>
    </div>
  )
}
export default PdfUploader
